const HistoryPage = () => {

    const [arr, setArr] = useState([])


    useEffect(() => {
        setArr(JSON.parse(localStorage.getItem('items')))
    }, [])

    const mapArr = arr.map((item) => {
        return (
            <div key={item.id}>{item.name}</div>
        )
    })    

    return (
        <MainContainer>
            <ConstainerIcon>
                <h1>GitHub Search History</h1>
                <ImageIcon src={iconGit} />
            </ConstainerIcon>

            {mapArr}

        </MainContainer>





    )













}

export default HistoryPage
